        <h1 >from 8 years</h1>
<p className="Section2-content-parah">Where to grow your business as a photographer: site or social media?.</p>
<button className="Section2-button">Register</button></Col>
<Col sm={6}><img src={Pathmodel} alt="src" className="Section1-img"></img></Col>

      </Row>
